// Node Module
var mongoose = require('mongoose');

// Customized Module
var Collection = require('../MongoDB/mongoose-schema/instagram'),         // this module contains database Schema and Model
    msgVariables   = require('../consoleLogMessage/variables');  // this module contains variables that prints console log message

// Creating structure for Collections, to be used in Database 
var Post    = Collection.Post,
    Comment = Collection.Comment,
    React   = Collection.React;

// CRUD operation createComments()
function seedDB(trigger = false){
    if(trigger){
        console.log('\n\n'  + msgVariables.setup_started);
        deleteDatabase(function(){
            createPost(function(){
                createComments(Instagram_comments[0], 0, function(){
                    createReacts(Instagram_reacts[0], 0, function(){
                        console.log(msgVariables.setup_done);
                    });
                });
            });
        });
    }
} 

function deleteDatabase(_callback){
    Post.deleteMany({}, function(err){
        if(err){
            console.log(msgVariables.partition + 'Failed to delete Database: Posts ! \nError: ' + err);
        } else {
            console.log(msgVariables.instagram_deleted);
            Comment.deleteMany({}, function(err){
                if(err){
                    console.log(msgVariables.partition + 'Failed to delete Database: Comments ! \nError: ' + err);
                } else {
                    console.log(msgVariables.comment_deleted);
                    React.deleteMany({}, function(err){
                        if(err){
                            console.log(msgVariables.partition + 'Failed to delete Database: Reacts ! \nError: ' + err);
                        } else {
                            console.log(msgVariables.react_deleted);
                            if(_callback != undefined){
                                _callback();
                            }
                        }
                    });
                }
            });
        }
    });
}

function createPost(_callback){
    Post.create(Post_details, function(err, retrivedData){
        if(err){
            console.log(msgVariables.partition + 'Failed to create database placeholder! \nError: ' + err)
        } else {
            console.log(msgVariables.placeholder_added);
            if(_callback != undefined){
                _callback();
            }
        }
    });
}
    

function createComments(entry_comment, index, _callback){
    // retriving details
    Post.find({}, function(err, retrivedDetails){
        if(err){
            console.log(msgVariables.partition + 'Failed to read placeholder details! \nError: ' + err)
        } else {
            // Adding comments in details
            let i = 0;
            retrivedDetails.forEach(function(details){
                // Creating comments
                Comment.create(entry_comment, function(err, retrivedComment){
                    if(err){
                        console.log(msgVariables.partition + 'Failed to create Comments! \nError: ' + err)
                    } else {
                        details.comments.push(retrivedComment);
                        details.save(function(err, retrivedData){
                            i+=1;
                            if(err){
                                console.log(msgVariables.partition + 'Failed to save commentsID in details placeholder! \nError: ' + err);
                            } else {
                                if(i == retrivedDetails.length){
                                    index+=1;
                                    if(index < Instagram_comments.length){
                                        createComments(Instagram_comments[index], index, _callback);
                                    } else {
                                        if(_callback != undefined){
                                            console.log(msgVariables.comment_added);
                                            _callback();
                                        }
                                    }
                                }
                            }
                        });
                        
                    }
                });
            });
        }
    });
}


function createReacts(entry_react, index, _callback){
    // retriving details
    Post.find({}, function(err, retrivedDetails){
        if(err){
            console.log(msgVariables.partition + 'Failed to read placeholder details! \nError: ' + err)
        } else {
            // Adding comments in details
            let i = 0;
            retrivedDetails.forEach(function(details){
                // Creating comments
                React.create(entry_react, function(err, retrivedReact){
                    if(err){
                        console.log(msgVariables.partition + 'Failed to create Reacts! \nError: ' + err)
                    } else {
                        details.reacts.push(retrivedReact);
                        details.save(function(err, retrivedData){
                            i+=1;
                            if(err){
                                console.log(msgVariables.partition + 'Failed to save commentsID in details placeholder! \nError: ' + err);
                            } else {
                                if(i == retrivedDetails.length){
                                    index+=1;
                                    if(index < Instagram_reacts.length){
                                        createReacts(Instagram_reacts[index], index, _callback);
                                    } else {
                                        if(_callback != undefined){
                                            console.log(msgVariables.react_added);
                                            _callback();
                                        }
                                    }
                                }
                            }
                        });
                        
                    }
                });
            });
        }
    });
}




